import React from 'react';
import "./styles.css";
import Sign from "../../assets/images/SQDPTsign.png"

function About() {
    return (
        <div id="container-div">
            <div id="about-div">
                <section id="about-section">
                    <img id="sqdpt-sign" src={Sign} alt="National Park style sign" />
                </section>
            </div>
        </div>
    );
}

export default About;
